INSERT INTO dash_entries VALUES(317,18,4,'Runner Efficiency','Shows how much time of the task runner is spent inside the actual execution of the function.',5,'line','[{"name":"snoop.data.tasks.call_function__duration","alias":"call_function__duration"},{"name":"snoop.data.tasks.run_task__duration","alias":"run_task__duration"}]','per_min($call_function__duration)/  per_min($run_task__duration) as runner_efficiency','{"runner_efficiency":{"unit":""}}');
INSERT INTO dash_entries VALUES(318,18,4,'Task Success Ratio','',4,'stacked-area','[{"name":"task_started","alias":"task_started"},{"name":"task_success","alias":"task_success"},{"name":"task_broken","alias":"task_broken"},{"name":"task_missing_dependency","alias":"task_missing_dependency"}]','per_min($task_success) / per_min($task_started) as success | per_min($task_broken)/ per_min($task_started) as broken | per_min($task_missing_dependency)/ per_min($task_started) as missing_dependency','{"broken":{"unit":""},"missing_dependency":{"unit":""},"success":{"unit":""}}');
INSERT INTO dash_entries VALUES(319,18,4,'Worker Parallelism','Number of workers executing tasks in parallel.',6,'line','[{"name":"snoop.data.tasks.call_function__duration","alias":"call_function__duration"},{"name":"snoop.data.tasks.run_task__duration","alias":"run_task__duration"}]','per_min($call_function__duration)/60 as active_workers | per_min($run_task__duration)/60 as active_including_overhead','{"active_including_overhead":{"unit":""},"active_workers":{"unit":""}}');
INSERT INTO dash_entries VALUES(320,18,4,'Task bytes/second groupped by collection','',3,'stacked-bar','[{"name":"snoop.data.tasks.call_function__size_bytes","alias":"call_function__size_bytes"}]','per_min($call_function__size_bytes)/60 as bytes_per_second | group by collection','{"bytes_per_second":{"unit":"bytes"}}');
INSERT INTO dash_entries VALUES(321,18,4,'Task Parallelism per Function','',2,'stacked-area','[{"name":"snoop.data.tasks.run_task__duration","alias":"run_task__duration"}]','per_sec($run_task__duration) as w | group by $run_task__duration.function_group','{"w":{"unit":""}}');
INSERT INTO dash_entries VALUES(322,18,4,'Task Parallelism by Collection','',1,'stacked-area','[{"name":"snoop.data.tasks.run_task__duration","alias":"run_task__duration"}]','per_sec($run_task__duration) as w | group by $run_task__duration.collection','{"w":{"unit":""}}');
